import React, { Component } from "react";
import RegisterForm from "../../components/Forms/SignUpForm";
import Button from "../../components/Button/Button";
import Greeting from "../../components/Greeting/Greeting";
import "./Signup.css";

export default function Signup() {
  return (
    <div>
      <header>
        <img
          className="arrow-back"
          src={require("./../../graphics/back_arrow_idle.png")}
          alt="back arrow"
          height="40"
          width="40"
        ></img>

        <div className="centering">
          <div className="title">
            <div className="app-title">Welcome to Tripster!</div>
          </div>
        </div>

        <div className="log-in">
          <div className="app-headline">Sign up</div>
        </div>

        <img
          className="paper-plane"
          src={require("./../../graphics/message_idle.png")}
          alt="Tripster Logo"
          height="40"
          width="40"
        ></img>
      </header>

      <div className="centering">
        <RegisterForm />
      </div>

      <div className="centering"></div>
    </div>
  );
}
